import React, { Component } from "react";
import { GoogleMap, withScriptjs, withGoogleMap } from 'react-google-maps';

function Map() {

    const center = {
        lat: 40.7128,
        lng: -73.935242
    };

    function initMap(){
          return (
            <GoogleMap
              center={center}
              zoom={10}
            />
          )
    }

    return(
      <div id="map">
          <script async defer src={`https://maps.googleapis.com/maps/api/js?key=${process.env.REACT_APP_GOOGLE_KEY}&callback=initMap`} type="text/javascript"></script>
      </div>
    )
}

export default Map;
